import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));
const Pricing = () => {
  return (
    <>
      <Grid container xs={12}>
        <Grid item xs={4} />
        <Grid item xs={2}>
          <Button
            variant="contained"
            sx={{ backgroundColor: "#f96b14", px: 3, py: 2 }}
            size="large"
          >
            Free
          </Button>
        </Grid>
        <Grid item xs={3}>
          <Button
            variant="contained"
            sx={{ backgroundColor: "grey", px: 3, py: 2 }}
            size="large"
          >
            Individual
          </Button>
        </Grid>
        <Grid item xs={3}>
          <Button
            variant="contained"
            sx={{ backgroundColor: "grey", px: 3, py: 2 }}
            size="large"
          >
            Team
          </Button>
        </Grid>
      </Grid>
    </>
  );
};
export default Pricing;
